# Prepare the payload
payload = {
    "prompt": "Create a funny meme from these images",
    "image_data_1": image_data_1,
    "image_data_2": image_data_2
}

# Send POST request to the Flask server
response = requests.post("http://127.0.0.1:5000/generate_meme", json=payload)

# Handle the response
if response.status_code == 200:
    response_json = response.json()
    image_data = response_json.get("image_data")
    if image_data:
        # Save the returned image
        with open("meme_result.png", "wb") as out_file:
            out_file.write(base64.b64decode(image_data))
        print("Meme image saved as meme_result.png")
    else:
        print("No image returned.")
else:
    print("Request failed:", response.status_code, response.text)

